import './App.css';
import Footer from './components/Footer';
import Heander from './components/Header';
import Main from './components/Main';

function App() {
  fetch(`http://localhost:3030/jsonstore/todos`)
    .then(res => console.log(res));

  return (
    <div>
      <Heander />

      <Main />

      <Footer />
    </div>
  );
}

export default App;
